import '../../styles/Main.css';
import '../../styles/Owner.css';
import photo from '../../img/my_house.webp';
import axios from 'axios';
import React, { useState, useEffect } from 'react';

function AddPremiseData() {
    const [photo, setPhoto] = useState(null);
    const [photo2, setPhoto2] = useState(null);
    const [typePremise, setTypePremise] = useState('Жилые помещение');
    const [pool, setPool] = useState('');
    const [billiards, setBilliards] = useState('');
    const [furniture, setFurniture] = useState('');
    const [repair, setRepair] = useState('');
    const [area, setArea] = useState('');
    const [price, setPrice] = useState('');
  
    const add = async (e) => {
        if(price === '' || surname === '') {
              setErrorText("Вы не заполнили все поля!"); 
              return;
        }

        try {
              const formData = new FormData();
              formData.append('name', name);
              formData.append('surname', surname);
              formData.append('phoneNumber', phoneNumber);
              console.log(ava);
              formData.append('photo', ava2);
              formData.append('login', login);

              const response = await axios.put('http://localhost:3001/user/edit', formData, {
                    headers: {
                        'Content-Type': 'multipart/form-data'
                    }
              });

              const user = response.data.user;
              console.log(response.data.user);
              
              localStorage.setItem('user', JSON.stringify(user));

              window.location.href = '/main';
        } catch (error) {
              console.error('Ошибка при изменении данных пользователя:', error);
        }
  } ;

    const activeZiliuyTypePremise = {
        backgroundColor: typePremise === 'Жилые помещение' ? 'rgb(60, 80, 254)' : 'transparent', // изменение цвета фона
        color: typePremise === 'Жилые помещение' ? 'white' : 'black', // изменение цвета текста
        border: 'none', // удаление границы
        borderRadius: '8px',
        cursor: 'pointer', // курсор при наведении
    };

    const activeSkladTypePremise = {
        backgroundColor: typePremise === 'Склады' ? 'rgb(60, 80, 254)' : 'transparent', // изменение цвета фона
        color: typePremise === 'Склады' ? 'white' : 'black', // изменение цвета текста
        border: 'none', // удаление границы
        borderRadius: '8px',
        cursor: 'pointer', // курсор при наведении
    };

    const activeEmptyTypePremise = {
        backgroundColor: typePremise === 'Пустые помещения' ? 'rgb(60, 80, 254)' : 'transparent', // изменение цвета фона
        color: typePremise === 'Пустые помещения' ? 'white' : 'black', // изменение цвета текста
        border: 'none', // удаление границы
        borderRadius: '8px',
        cursor: 'pointer', // курсор при наведении
    };

    const activeOfficeTypePremise = {
        backgroundColor: typePremise === 'Офисы' ? 'rgb(60, 80, 254)' : 'transparent', // изменение цвета фона
        color: typePremise === 'Офисы' ? 'white' : 'black', // изменение цвета текста
        border: 'none', // удаление границы
        borderRadius: '8px',
        cursor: 'pointer', // курсор при наведении
    };

    const activeComercialTypePremise = {
        backgroundColor: typePremise === 'Комерчиские помещения' ? 'rgb(60, 80, 254)' : 'transparent', // изменение цвета фона
        color: typePremise === 'Комерчиские помещения' ? 'white' : 'black', // изменение цвета текста
        border: 'none', // удаление границы
        borderRadius: '8px',
        cursor: 'pointer', // курсор при наведении
    };

    const changePhoto = (e) => {
        const file = e.target.files[0];
        const reader = new FileReader();
        
        setPhoto2(file);
        reader.onloadend = () => {
              setPhoto(reader.result);
        };
    
        if (file) {
          reader.readAsDataURL(file);
        }
  };
    

	return (
        <div className="premiseData">
            <form className='premisePhotoController'>
                <img src={photo} alt="Uploaded"/>
                <input type="file" accept="image/*" className='loadPremisePhoto' onChange={changePhoto}/>
                <input type="text" className='premiseName' placeholder='Название помещения'/>
                <input type="text" className='premiseName' placeholder='адресс'/>
                <div className='changeCharacteristicList'>
                    <button type="button" style={activeZiliuyTypePremise} onClick={() => setTypePremise("Жилые помещение")}>Жилые помещение</button>
                    <button type="button" style={activeEmptyTypePremise} onClick={() => setTypePremise("Пустые помещения")}>Пустые помещения</button>
                    <button type="button" style={activeComercialTypePremise} onClick={() => setTypePremise("Комерчиские помещения")}>Комерчиские помещения</button>
                    <button type="button" style={activeOfficeTypePremise} onClick={() => setTypePremise("Офисы")}>Офисы</button>
                    <button type="button" style={activeSkladTypePremise} onClick={() => setTypePremise("Склады")}>Склады</button>
                </div>
            </form> 
            
            {typePremise === 'Жилые помещение' && (
                <form className="premiseCharacteristics">
                    <div className="area-price">
                        <input type='number' placeholder='Цена' value={price} onChange={(e) => setPrice(e.target.value)}/>
                        <input type='number' placeholder='Площадь' value={area} onChange={(e) => setArea(e.target.value)}/>
                    </div>
